from typing import List

class Solution:

    def findDiagonalOrder(self, nums: List[List[int]]) -> List[int]:

        def generateTable(dimension):


            def generateLeft():
                LeftList = []

                for i in range(dimension):
                    LeftList.append((i * dimension)+1)

                    for j in range(i):
                        LeftList.append(LeftList[-1] - (dimension-1))

                return LeftList

            def generateRight():
                RightList = []

                for i in range(dimension-2, -1,-1):
                    num = dimension**2 - i
                    RightList.append(num)
                    
                    for j in range(i):
                        RightList.append(RightList[-1] - (dimension-1))

                return RightList

            return generateLeft() + generateRight()

        def fillTheGap(dimension):
            x = []
            for i in range(len(nums)):
                if len(nums[i]) < dimension:
                    for j in range(dimension-len(nums[i])):
                        nums[i].append(0)
                x+=nums[i]


            return x

        if len(nums) == 1:
            return nums[0]

        lengthOfLists = list(map(len, nums))
        
        if max(lengthOfLists) == 1:
            ans = []
            for i in nums:
                ans+=i
            return ans

        lengthOfLists.append(len(nums))
        dimension = max(lengthOfLists)
        filledNums = fillTheGap(dimension=dimension)
        generatedTable = generateTable(dimension=dimension)
        for i in range(len(generatedTable)):
            generatedTable[i] -= 1

        if len(filledNums) < len(generatedTable):
            for i in range(len(generatedTable)-len(filledNums)):
                filledNums.append(0)

        answer = list(map(lambda e: filledNums[e],generatedTable))
        final_answer = []
        for i in answer:
            if i!=0:
                final_answer.append(i)

        return final_answer


